50	Wenger - I couldn't say no to Ozil	Arsène Wenger thinks there was no "special emptiness" in Arsenal's midfield before the signing of Mesut Ozil.\r\nThe German playmaker arrived in north London last month for a Club record fee and has made an instant impact with a number of eye-catching displays.\r\n\r\n\r\nI believe what is important is what you see when a team plays, the rest you have to cope with\r\nArsène Wenger \r\n\r\nDespite having a plethora of midfielders at his disposal, Wenger insists he couldn't turn down the chance to sign Ozil.\r\n"You have to look at the quality first and when you have high expectation levels you can't turn down a world-class player," said Wenger.\r\n"There was no special emptiness in that position but the quality was so big it was too difficult to say no.\r\n"I believe what is important is what you see when a team plays, the rest you have to cope with," Wenger added.\r\n"Look at Bayern [Munich] the other night, they have [Javi] Martinez and [Mario] Goetze on the bench.\r\n"People said the team cost £92 million and Man City cost £190 million, but Bayern had over £100 million on the bench. That's part of big clubs today, having big players on the bench."\n\nIsaac Moore\n\n4 Oct 2013\n\n	http://www.arsenal.com/assets/_files/scaled/696x392/sep_13/gun__1378990185_Ozil2.jpg	2013-10-10 13:21:08.116679	2013-10-10 13:21:08.116679
51	Extra: Wenger on Rosicky and away form	Arsène Wenger faced the media ahead of the Premier League clash with West Bromwich Albion. Here's our round-up of the manager's quotes. For the headlines, visit our Digest page:\r\non birthday boy Tomas Rosicky... First of all I believe he is a real Arsenal man because he is here for a long time. He is really a football player who presents the way we want to play football, because he's a team player who has pace, has a quick brain, understands the game well, and I always like to have him in the team because of all these qualities.\r\non the reason for Arsenal's away form... Basically because we don't look too much at the fact [whether] it is away or home. We play with the same desire and the same attitude, and as well because we have a level of confidence that is there. But West Brom represents as well a good test for us because, on the back of an outstanding result at Manchester United, their confidence is certainly high as well, so it will be a very interesting test.\r\non maintaining the winning run... For us it is important to maintain our consistent run and to continue to develop as a team because if you look at the broader picture we have had quite a good consistent run since March. But it is important of course that we continue to develop. I believe we can still do better, that there is more to come from us, but that will depend now on how much we want it and how hungry we are to improve.\r\nTwitter\r\nUse our dedicated hashtag to join the match conversation\r\n#WBAvAFC\r\n\n4 Oct 2013\n\n	http://player.arsenal.com/site_media/images/uploaded/videothumbs/8994afbe01ebd096c59296137722e307/552x310/idx-5.jpg	2013-10-10 13:21:08.431098	2013-10-10 13:21:08.431098
52	Wenger: I'll speak to Jack about smoking	Arsène Wenger will speak to Jack Wilshere after the England international was pictured smoking.\r\nThe Arsenal manager will keep his discussions with Wilshere private but he explained why he was against smoking when the issue was raised at his pre-match press conference.\r\n"I don't know really what happened [with Jack], I will need to have a chat with him about that," said Wenger. "I disagree completely with that behaviour.\r\n"There are two things: first of all when you are a football player you are an example, and as well you don't do what damages your health.\r\n\r\n\r\nFirst of all when you are a football player you are an example, and as well you don't do what damages your health\r\n\r\n\r\n"The fact [is] you can damage your health at home, you can smoke at home and you can drink at home, and nobody sees it, but when you go out socially you as well damage your reputation as an example."\r\nWenger was reminded that Dutch legend Johan Cruyff used to smoke 20 cigarettes a day, and the Arsenal manager is glad that football and society have moved on.\r\n"Things are different in England especially," he said. "You don't need to convince me [of that] because, I must tell you, I travelled as a football player on coaches after games in France where you didn't see each other, there was so much smoke on the coach!\r\n"Everybody smoked. But times have changed and the health worry, the example, the role model [expected] from the football players has changed as well.\r\n"And I must say as well, English society is very sensitive to smoking, much more than France, more than southern countries. So it is a bit more shocking here than it is somewhere else."\r\n\nPress conference\n\nChris Harris\n\n4 Oct 2013\n\n	http://player.arsenal.com/site_media/images/uploaded/videothumbs/7288fc10d8a7e8ec25bc8c295527a609/552x310/idx-1.jpg	2013-10-10 13:21:08.49128	2013-10-10 13:21:08.49128
53	Wenger - Winter World Cup reasonable 	Arsène Wenger says Arsenal will support whatever the FA decides to do when it comes to the Qatar World Cup in 2022.\r\nFifa president Sepp Blatter recently said he wanted to move the tournament away from its traditional months of June and July in nine years' time.\r\n\r\n\r\nThe players can cope with the heat because they are prepared. They will be in great condition\r\nArsène Wenger\r\n\r\nWenger thinks it's a feasible idea to play the competition in winter but stressed that the safety of the supporters is the most important thing to take into consideration.\r\n"Arsenal will do what English football decides," said Wenger. "Of course we want to adapt to the behaviour of English football.\r\n"To me it looks reasonable to play in the winter because the only thing that matters is the safety of the supporters who go there and attend the games.\r\n"The players can cope with the heat because they are prepared. They will be in great condition."\r\nFootball League chairman Greg Clarke said there should be a re-vote on Thursday but Wenger disagreed when he was asked if he would back a re-election process.\r\n"No, unless there are some irregularities proven, then yes. But if there is nothing irregular which has happened, why should you re-vote?\r\n"Otherwise you can then ask every time that people are not happy with what comes out to vote again. You have to respect the vote and adapt to the situation.\r\n"The only thing to me which looks surprising is they have not considered that [summer heat] at the moment of the vote."\r\n\nPress conference\n\nIsaac Moore\n\n4 Oct 2013\n\n	http://player.arsenal.com/site_media/images/uploaded/videothumbs/f9a5f814dd53dba7f0e78ddf53a872cc/552x310/idx-5.jpg	2013-10-10 13:21:08.566602	2013-10-10 13:21:08.566602
38	Ramsey is Arsenal Player of the Month 	Aaron Ramsey is the Arsenal Player of the Month once again! \r\nThe Welsh midfielder has claimed the award for the third time on the bounce after scoring five goals in September. Ramsey recieved a huge 72.2 per cent of the vote, with new signings Mesut Ozil and Mathieu Flamini coming second and third respectively. The total number of votes came to 14,129 - the second-highest tally ever, after August 2013.  \r\nAfter netting three times in August, the Ramsey continued his fine form in front of goal. The 22-year-old bagged a brace in the 3-1 win at Sunderland before scoring Arsenal's second in the 2-1 victory over Marseille four days later. \r\nHe found the net again in the home game against Stoke and rounded off a fantastic month with the Gunners' second in the 2-1 win at Swansea City. \r\n\r\nSeptember Player of the Month - Results\r\n\r\nPlayer\r\n% of votes\r\nAaron Ramsey \r\n72.2 \r\nMesut Ozil \r\n17 \r\nMathieu Flamini \r\n5.6\r\nOther \r\n5.2\r\n\r\n\r\n Mark Craigie from Basingstoke has been chosen to present the award to Aaron before the Norwich City game at Emirates Stadium. He will also receive two tickets to the match. \r\n\r\nThis season's winners\r\n\r\nMonth \r\nPlayer\r\nAugust, 2013\r\nAaron Ramsey\r\n\n9 Oct 2013\n\n	http://www.arsenal.com/assets/_files/scaled/696x392/sep_13/gun__1380527067_ramsea_swansea2.jpg	2013-10-10 13:21:05.712317	2013-10-10 13:21:05.712317
